// src/components/DashboardContainer.js
import React from 'react';
import DashboardTable from './DashboardTable';

const DashboardContainer = () => {
  // Placeholder data - you would fetch this from an API or context in a real app
  const studentsData = [
    {
      id: 1,
      name: 'Alice Johnson',
      submissions: [
        { fileName: 'Submission1.pdf', submittedOn: '2023-05-01' },
        // ... other submissions
      ],
      grade: 'A-',
      comments: 'Great work! Keep it up.',
    },
    // ... other students
  ];

  return (
    <div>
      <DashboardTable students={studentsData} />
    </div>
  );
};

export default DashboardContainer;
